const levels =['하', '중', '상']

const SelectLevel = () => {

    const selectLevel = (e) => {
        e.stopPropagation();
        console.log(e.currentTarget.id);
    }

    return (
        <div className="flex justify-around items-center w-full h-[50%] pt-[1%]">
            {levels.map((level, index) => {
                return (
                <div onClick={selectLevel} id={index} key={index} className="flex justify-around items-center w-[8%] h-full border border-sharkGray rounded-lg">
                    <div className="font-['MaplestoryOTFBold'] text-xl">
                        {level}
                    </div>
                </div>)    
            })}
        </div>
    )
}

export default SelectLevel;
